import React from 'react';

function Payment({payment, handleDeletePayment}) {
  return (
    <li className="list-group-item list-group-item-light">
      <div className="d-flex justify-content-between align-items-center">
        <p className="mb-0 fs-4">{payment.name} paid {payment.cost} for {payment.reason}</p>
        <button className="btn btn-secondary" onClick={() => handleDeletePayment(payment.idPayment)}>Delete</button>
      </div>
    </li>
  )
}

function ListPayment({listPayment, handleDeletePayment}) {
  // Retourne null si la liste est vide
  if (listPayment.length === 0) {
    return null;
  }

  // Si la liste n'est pas vide, retourne les éléments
  return (
    <>
      {listPayment.map((payment) => (
        <Payment 
          payment={payment} 
          key={payment.idPayment} 
          handleDeletePayment={handleDeletePayment}
        />
      ))}
    </>
  );
}

export default ListPayment;
